function getUrlwindow(e){for(var n=$(location).attr("search").substring(1).split("&"),d=0;d<n.length;d++){var o=n[d].split("=");if(o[0]==e)return o[1]}}var email=decodeURIComponent(getUrlwindow("email")),username=decodeURIComponent(getUrlwindow("username")),phone_number=decodeURIComponent(getUrlwindow("phone_number")),address=decodeURIComponent(getUrlwindow("address")),address_2=decodeURIComponent(getUrlwindow("address_2")),message=decodeURIComponent(getUrlwindow("message"));$(".email").html("Email: "+email),$(".username").html("Tên của bạn: "+username),$(".phone_number").html("Phone: "+phone_number),$(".message").html("Ghi chú: "+message),$(".address").html("Phường - Xã: "+address),$(".address_2").html("Tỉnh - Thành: "+address_2);